import React from 'react'
import './AboutImages.css'

function AboutUsImage() {
    return (
        <div>
            <img className='About_Page_Desktop' src="/images/desktop-image-about-hero.jpg" alt=""/>
            <img className='About_Page_Tablet' src="/images/tablet-about-hero.jpg" alt=""/>
            <img className='About_Page_Mobile' id='Mobile-' src="/images/mobile-about-hero.jpg" alt=""/>

        </div>
    )
}

export default AboutUsImage
